import React from 'react'

const Navbar = () => {
    return (
        <div>
            <nav className="navbar navbar-light bg-dark">
                <a className="navbar-brand" href="#">
                    <img src="/docs/4.0/assets/brand/bootstrap-solid.svg" width={30} height={30} alt />
                </a>
            </nav>
        </div>
    )
}

export default Navbar
